import React, { useState } from "react";
import "./Profile.css";
import { useUser } from "../context/UserContext"; // Adjust the path based on your file structure

function Profile() {
  const { userData, setUserData } = useUser();
  const [isEditing, setIsEditing] = useState(false);
  const [editedData, setEditedData] = useState({ ...userData });

  const toggleEdit = () => {
    setIsEditing(!isEditing);
    setEditedData({ ...userData }); // Reset edits if canceled
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setEditedData((prev) => ({ ...prev, [name]: value }));
  };

  const saveChanges = () => {
    setUserData(editedData); // Save updates to context
    setIsEditing(false); // Exit edit mode
  };

  return (
    <div className="profile-container">
      <h1>User Profile</h1>
      <p>Manage your account and preferences here.</p>
      <div className="profile-card">
        {/* Name */}
        <div className="profile-detail">
          <span className="profile-icon">👤</span>
          <span>
            <strong>Name:</strong>
            {isEditing ? (
              <>
                <input
                  type="text"
                  name="firstName"
                  value={editedData.firstName}
                  onChange={handleChange}
                  className="profile-input"
                />{" "}
                <input
                  type="text"
                  name="lastName"
                  value={editedData.lastName}
                  onChange={handleChange}
                  className="profile-input"
                />
              </>
            ) : (
              `${userData.firstName} ${userData.lastName}`
            )}
          </span>
        </div>

        {/* Email */}
        <div className="profile-detail">
          <span className="profile-icon">📧</span>
          <span>
            <strong>Email:</strong>{" "}
            {isEditing ? (
              <input
                type="email"
                name="email"
                value={editedData.email}
                onChange={handleChange}
                className="profile-input"
              />
            ) : (
              userData.email
            )}
          </span>
        </div>

        {/* Goals */}
        <div className="profile-detail">
          <span className="profile-icon">🎯</span>
          <span>
            <strong>Goals:</strong>{" "}
            {isEditing ? (
              <textarea
                name="goals"
                value={editedData.goals.join(", ")}
                onChange={(e) =>
                  setEditedData((prev) => ({
                    ...prev,
                    goals: e.target.value.split(",").map((goal) => goal.trim()),
                  }))
                }
                className="profile-input"
              />
            ) : (
              userData.goals.join(", ")
            )}
          </span>
        </div>

        {/* Add other fields (Weekly Goal, Activity Level, etc.) */}
        {/* Example for Date of Birth */}
        <div className="profile-detail">
          <span className="profile-icon">🎂</span>
          <span>
            <strong>Date of Birth:</strong>{" "}
            {isEditing ? (
              <input
                type="date"
                name="dob"
                value={editedData.dob}
                onChange={handleChange}
                className="profile-input"
              />
            ) : (
              userData.dob
            )}
          </span>
        </div>
      </div>

      {/* Buttons */}
      <div className="profile-actions">
        {isEditing ? (
          <>
            <button className="btn-primary" onClick={saveChanges}>
              Save Changes
            </button>
            <button className="btn-secondary" onClick={toggleEdit}>
              Cancel
            </button>
          </>
        ) : (
          <button className="btn-primary" onClick={toggleEdit}>
            Edit Profile
          </button>
        )}
      </div>
    </div>
  );
}

export default Profile;
